<script type="module">
      import { GoogleGenerativeAI } from "@google/generative-ai";
      // Fetch your API_KEY (this is restricted to work from https://celestine-preetham.github.io/ )
	  const API_KEY = "AIzaSyBsQOaGoQj-AOF_Q6GDvBjHkXCB2XnYq7A";
      // Access your API key (see "Set up your API key" above)
      const genAI = new GoogleGenerativeAI(API_KEY);
	 
	 async function run(prompt) {
      // The Gemini 1.5 models are versatile and work with most use cases
     const   model = genAI.getGenerativeModel({ model: "gemini-1.5-flash"});
	   //Generate content using a prompt and the metadata of the uploaded file.
var result =   await model.generateContent("Translate the text : " + prompt + ", to an output of the form [food item in English, Quantity in grams]. Assume the quantity of a standard portion in grams, if not mentioned. Do not give any explanations.");
var txt;var txt2;var txt3;
console.log(txt= await result.response.text());
txt = txt.trim().slice(1, -1).split(',');
inputElement.value = Number(txt[1]); // Set the quantity of ingredient
ind = ingredients.findIndex((str) => str.includes(txt[0].toLowerCase().replace('.', '')));
 if(ind > -1){return ingredients[ind]+' : '+fiberdat[ind].toFixed(2)} // Return from database if found
else {
result =   await model.generateContent("Provide a list of ingredients in the form [food item in English,...] to make " + txt[0]+". Do not give any explanations.");
console.log(txt2= await result.response.text());
txt2 = txt2.trim().slice(1, -1).split(',');
result =   await model.generateContent("Provide a list of numbers [weight in grams,...] corresponding to a list of raw ingredients "+txt2+" to make " + txt[0]+". Do not give any explanations.");
console.log(txt3= await result.response.text());
txt3 = txt3.trim().slice(1, -1).split(',');
//Return computed fiber content
return txt[0]+findIngredientContent(txt2,txt3)}
}
function findIngredientContent(items,quantities)
{
let weight=0;let fiber = 0;
for(let i=0;i<items.length;i++)
{
	weight+=Number(quantities[i]);
	ind = ingredients.findIndex( (str) => str.includes(items[i].trim().toLowerCase().replace('.', '')));
	console.log(ingredients[ind]+' : '+fiberdat[ind])
 if(ind > -1){
fiber+=Number(quantities[i])*fiberdat[ind]} 
}
console.log(weight+' '+fiber)
return ' : '+(fiber/weight).toFixed(2)
}
	  window.run = run;

async function  firstmatch(targetString){
console.log(targetString)
 ind = ingredients.findIndex((str) => str.includes(targetString.toLowerCase().replace('.', '')));
 if(ind > -1){return ingredients[ind]+' : '+fiberdat[ind].toFixed(2)} 
else {return await run(targetString)} }


async function startRecording() {
    recognition = new webkitSpeechRecognition();
    recognition.continuous = true;
    recognition.interimResults = false;
	
    recognition.onresult = async (event) => {
        transcript =  await firstmatch(event.results[event.results.length - 1][0].transcript);
		    // Display the transcription on the button
    recordButton.textContent = transcript;
    recordButton.classList.remove('blink-button'); // Stop blinking
	  // Create a new blinking button below
    createNewButton();
    };
	 recognition.onnomatch = (event) => {
    recordButton.classList.remove('blink-button'); // Stop blinking
    };
    recognition.start();
}

createNewButton();


function createNewButton() {
// Create the container div
        containerDiv = document.createElement('div');
        containerDiv.classList.add('container');

        // Create the input element
        inputElement = document.createElement('input');
        inputElement.id = 'userInput';
        inputElement.value = 100;
		inputElement.type ='number';
		
        // Create the button element
    recordButton = document.createElement('button');
    recordButton.classList.add('blink-button');
    recordButton.textContent = '🍽️';
	recordButton.addEventListener('click',(event) => {
     event.target.parentNode.remove();
});

        // Append elements to the container div
        containerDiv.appendChild(inputElement);
        containerDiv.appendChild(recordButton);


        // Append the container div to the body
        document.body.appendChild(containerDiv);
	startRecording();
}

function onSubmit() {
 divs = document.getElementsByTagName("div");
totF = 0;
for (var i = 0; i < divs.length; i++) {
    // Do something with each div, e.g., divs[i].innerHTML = "something new...";
 totF+=  divs[i].querySelector('input').valueAsNumber/100 * parseFloat( divs[i].querySelector('button').textContent.split(":")[1].trim());
}

 document.getElementById("submit").value = "Total fiber content is : "+ totF.toFixed(2)+ " g";
}
